import React from "react";
import SportCard from "../components/SportCard";

export default function Sports({ books }) {
  const imgData = [
    `data:image/jpeg;base64,`,
    `data:image/jpeg;base64,`,
    `data:image/jpeg;base64,`,
  ];
  return (
    <>
      <h2>Sports</h2>
      {books && (
        <div className="card-list">
          {books.map((book) => (
            <SportCard
              src={imgData[Math.floor(Math.random() * 3 + 0)]}
              bookName={book.bookName}
              author={book.author}
            />
          ))}
        </div>
      )}
    </>
  );
}
